import React from "react";
import { Link } from "react-router-dom";

const restaurants = [
  {
    id: 1,
    name: "KFC",
    description: "Crispy fried chicken and zinger burgers.",
    image:"data:image/png;base64,",
    route: "/kfc/1",
  },
  {
    id: 2,
    name: "McDonald's",
    description: "Famous for Big Mac and fries.",
    image: "https://1000logos.net/wp-content/uploads/2017/03/McDonalds-logo.png",
    route: "/mcdo/1",
  },
  {
    id: 3,
    name: "Domino's Pizza",
    description: "Delicious pizzas with various toppings.",
    image: "data:image/jpeg;base64,",
    route: "/restaurant/3",
  },
  {
    id: 4,
    name: "Burger King",
    description: "Home of the Whopper.",
    image: "data:image/jpeg;base64,",
    route: "/restaurant/4",
  },
  {
    id: 5,
    name: "Subway",
    description: "Eat fresh with subs and sandwiches.",
    image: "data:image/png;base64,",
    route: "/restaurant/5",
  },
];

const ResList = () => {
  return (
    <div className="res-list" >
      <h2>Top Restaurants</h2>
      <div className="res-container" style={{ display: 'flex', gap: '20px', flexWrap: 'wrap' }}>
        {restaurants.map((res) => (
          <Link
            to={res.route}
            key={res.id}
            style={{
              textDecoration: "none",
              color: "inherit",
              border: "1px solid #ccc",
              borderRadius: "8px",
              padding: "10px",
              width: "200px",
              boxShadow: "2px 2px 10px #ddd",
              background: "#fff",
            }}
          >
            <img
              src={res.image}
              alt={res.name}
              style={{ width: "100%", height: "100px", objectFit: "contain" }}
            />
            <h4>{res.name}</h4>
            <p style={{ fontSize: "14px" }}>{res.description}</p>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default ResList;
